script: |
  super -f tsv -I q3602.sql | sort > q3602.out

vector: true

inputs:
  - name: q3602.sql
    data: |
      SELECT ALL MAX ( DISTINCT + - col0 ) AS col0 FROM tab0 WHERE NOT col2 BETWEEN + 72 * + col2 * - col1 AND + col1 + - - ( - - col0 ) - - 13 OR - col0 <> NULL;
  - name: tab0

outputs:
  - name: q3602.out
    data: |
      NULL
